&lt;BusinessService xmlns=&quot;&quot;&gt;
  &lt;Formular name=&quot;StopSAP&quot; title=&quot;Stoppen von SAP Systemen beantragen&quot; proportionalTypo=&quot;true&quot;&gt;
    &lt;Fields&gt;
      &lt;TextField id=&quot;Text_01&quot; label=&quot;Stoppen von SAP Systemen&quot; mandatory=&quot;false&quot;&gt;
        &lt;Text type=&quot;HeadlineOne&quot;&gt;Stoppen von SAP Systemen&lt;/Text&gt;
      &lt;/TextField&gt;
      &lt;LineField id=&quot;Linie_01&quot; mandatory=&quot;false&quot; /&gt;
      &lt;TextField id=&quot;Text_03&quot; label=&quot;W&#228;hlen Sie ein SAP System aus der Liste oder geben Sie ein SAP System ein.&quot; mandatory=&quot;false&quot;&gt;
        &lt;Text type=&quot;Standard&quot;&gt;W&#228;hlen Sie ein SAP System aus der Liste oder geben Sie ein SAP System ein.&lt;/Text&gt;
      &lt;/TextField&gt;
      &lt;ChoiceField id=&quot;SAP_Auswahl_01&quot; label=&quot;SAP System w&#228;hlen&quot; mandatory=&quot;false&quot;&gt;
        &lt;Values&gt;AB1;CC_TEST2;CD2;FG4;HI3;JY3;ZX7&lt;/Values&gt;
      &lt;/ChoiceField&gt;
      &lt;InputField id=&quot;SAP_Eingabe_01&quot; label=&quot;oder SAP Systemnamen eingeben&quot; mandatory=&quot;false&quot; placeholder=&quot;Hier alternativ den SAP Systemnamen eingeben&quot;&gt;
        &lt;Validation /&gt;
      &lt;/InputField&gt;
      &lt;TextField id=&quot;Text_05&quot; label=&quot;Ab wann sollen keine Kunden Streame mehr gestartet werden?&quot; mandatory=&quot;false&quot;&gt;
        &lt;Text type=&quot;HeadlineTwo&quot;&gt;Ab wann sollen keine Kunden Streame mehr gestartet werden?&lt;/Text&gt;
      &lt;/TextField&gt;
      &lt;DateField id=&quot;Stream_Datum_01&quot; label=&quot;Startdatum&quot; mandatory=&quot;true&quot; placeholder=&quot;Datum, ab dem keine Kunden Streams mehr starten sollen&quot;&gt;
        &lt;Date&gt;
          &lt;Default offset=&quot;0&quot; daytype=&quot;CalendarDay&quot; /&gt;
        &lt;/Date&gt;
      &lt;/DateField&gt;
      &lt;TimeField id=&quot;Stream_Uhrzeit_01&quot; label=&quot;Startzeit&quot; mandatory=&quot;true&quot; placeholder=&quot;Uhrzeit, ab der keine Kunden Streams mehr starten sollen&quot;&gt;
        &lt;Time default=&quot;&quot; /&gt;
      &lt;/TimeField&gt;
      &lt;TextField id=&quot;Text_07&quot; label=&quot;Wann soll das gew&#228;hlte SAP System heruntergefahren werden?&quot; mandatory=&quot;false&quot;&gt;
        &lt;Text type=&quot;HeadlineTwo&quot;&gt;Wann soll das gew&#228;hlte SAP System heruntergefahren werden?&lt;/Text&gt;
      &lt;/TextField&gt;
      &lt;DateField id=&quot;SAP_Datum_01&quot; label=&quot;Startdatum&quot; mandatory=&quot;true&quot; placeholder=&quot;Datum, an dem das SAP System heruntergefahren werden soll&quot;&gt;
        &lt;Date&gt;
          &lt;Default offset=&quot;0&quot; daytype=&quot;CalendarDay&quot; /&gt;
        &lt;/Date&gt;
      &lt;/DateField&gt;
      &lt;TimeField id=&quot;SAP_Uhrzeit_01&quot; label=&quot;Startzeit&quot; mandatory=&quot;true&quot; placeholder=&quot;Uhrzeit, zu der das SAP System heruntergefahren werden soll&quot;&gt;
        &lt;Time default=&quot;&quot; /&gt;
      &lt;/TimeField&gt;
      &lt;CheckBoxField id=&quot;Warten_01&quot; label=&quot;Soll auf das Ende der Kunden Streams gewartet werden?&quot; mandatory=&quot;false&quot;&gt;
        &lt;CheckBox initial=&quot;true&quot;&gt;Haken gesetzt = ja&lt;/CheckBox&gt;
      &lt;/CheckBoxField&gt;
    &lt;/Fields&gt;
  &lt;/Formular&gt;
&lt;/BusinessService&gt;

&lt;BusinessService xmlns=&quot;&quot;&gt;
  &lt;Formular name=&quot;Stream010A&quot; title=&quot;Form A for Strean010&quot; proportionalTypo=&quot;true&quot;&gt;
    &lt;Fields&gt;
      &lt;LineField id=&quot;Line1&quot; mandatory=&quot;false&quot; /&gt;
      &lt;InputField id=&quot;CustomerCode&quot; label=&quot;Customer Code&quot; mandatory=&quot;true&quot; placeholder=&quot;CustomerCode&quot;&gt;
        &lt;Validation /&gt;
        &lt;InputValue default=&quot;ABCDE&quot; /&gt;
      &lt;/InputField&gt;
      &lt;LineField id=&quot;Line2&quot; mandatory=&quot;false&quot; /&gt;
      &lt;DateField id=&quot;CustDate&quot; label=&quot;Customer Date&quot; mandatory=&quot;true&quot; placeholder=&quot;CustomerDate&quot;&gt;
        &lt;Date&gt;
          &lt;Default offset=&quot;-1&quot; daytype=&quot;CalendarDay&quot; /&gt;
          &lt;Range offsetLeft=&quot;-10&quot; daytypeLeft=&quot;CalendarDay&quot; offsetRight=&quot;30&quot; daytypeRight=&quot;CalendarDay&quot; /&gt;
        &lt;/Date&gt;
      &lt;/DateField&gt;
    &lt;/Fields&gt;
  &lt;/Formular&gt;
&lt;/BusinessService&gt;
